import '../css/App.css';
// import User from "../components/User/User";



function App() { 
  let history = useHistory()

  const toMap = () => (
    history.push({
      pathname:"/map"
    })
  );

  return (
    <>
      <h1>COMP90024 CCC-P2</h1>
      <Button variant="secondary" onClick={toMap}>
          Start
      </Button>
    </>
  );
}

export default App;
